/**
 * The main function to initialize the WpGod plugin.
 */
function wpgod_initialize_plugin() {
	// You can add your plugin's initialization code here.
	// For example, adding hooks, setting up options, etc.

	// Example: Log a message to the error log when the plugin initializes.
	// Make sure WP_DEBUG and WP_DEBUG_LOG are enabled in your wp-config.php for this to work easily.
	error_log( 'WpGod Plugin Initialized!' );
  wp_enqueue_style('wpGod-style', plugin_dir_url( __FILE__ ) . 'css/wpGod.css' );
  wp_enqueue_script('wpGod-script', plugin_dir_url( __FILE__ ) . 'jsClass/WpGod.js', array(), null, true);
}
add_action( 'plugins_loaded', 'wpgod_initialize_plugin' ); // Changed to plugins_loaded for better practice with init tasks
 

/**
 * Adds the WpGod admin menu.
 */
function wpgod_add_admin_menu() {
    // Ejemplo de SVG (un círculo simple) codificado en base64
    // Deberías reemplazar esto con tu propio SVG codificado.
    // SVG original: <svg width="20" height="20" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><circle cx="10" cy="10" r="8" fill="currentColor"/></svg>
    $icon_svg_base64 = 'data:image/svg+xml;base64,';

    add_menu_page(
        __( 'WpGod', 'wpgod' ), // Page title
        __( 'WpGod', 'wpgod' ),          // Menu title
        'manage_options',                // Capability required to see this option
        'wpgod',                         // Menu slug (should be unique)
        'wpgod_page_html',      // Function to display the page content
        $icon_svg_base64,                // Icon URL (SVG codificado en base64)
        20                               // Position in the menu
    );

    // Submenu: DB Analysis
    add_submenu_page(
        "wpgod",                         // Parent slug
        __( "DB Analysis", "wpgod" ),    // Page title
        __( "DB Analysis", "wpgod" ),    // Menu title
        "manage_options",                // Capability
        "wpgod-db-analysis",             // Menu slug
        "wpgod_db_analysis_page_html"    // Function to display page content
    );

    // Submenu: Content Analisis
    add_submenu_page(
        'wpgod',                         // Parent slug
        __( 'Content Analysis', 'wpgod' ), // Page title
        __( 'Content Analysis', 'wpgod' ), // Menu title
        'manage_options',                // Capability
        'wpgod-content-analysis',        // Menu slug
        'wpgod_content_analysis_page_html' // Function to display page content
    );

    // Submenu: Media Content Analysis
    add_submenu_page(
        'wpgod',                               // Parent slug
        __( 'Media Content Analysis', 'wpgod' ), // Page title
        __( 'Media Analysis', 'wpgod' ),       // Menu title (shorter for the menu)
        'manage_options',                      // Capability
        'wpgod-media-analysis',                // Menu slug (único)
        'wpgod_media_analysis_page_html'       // Function to display page content
    );

     // Submenu: Donaciones
    add_submenu_page(
        "wpgod",                         // Parent slug
        __( "Support Me", "wpgod" ),        // Page title
        __( "Support Me", "wpgod" ),        // Menu title
        "manage_options",                // Capability
        "wpgod-supportme",               // Menu slug
        "wpgod_supportme_page_html"      // Function to display page content
    );

    // Submenu: Donaciones
    add_submenu_page(
        "wpgod",                         // Parent slug
        __( "Powered By", "wpgod" ),        // Page title
        __( "Powered By", "wpgod" ),        // Menu title
        "manage_options",                // Capability
        "wpgod-poweredby",               // Menu slug
        "wpgod_poweredby_page_html"      // Function to display page content
    );
}
add_action( 'admin_menu', 'wpgod_add_admin_menu' );
